CREATE TABLE SGDTEST.PPD_TRAZ_DOCUMENTO
(
    IDE_TRAZ_DOCUMENTO NUMBER(18) PRIMARY KEY NOT NULL,
    IDE_PPD_DOCUMENTO NUMBER(18) NOT NULL,
    FEC_TRAZ_DOCUMENTO TIMESTAMP(6) NOT NULL,
    OBSERVACION VARCHAR2(500),
    IDE_FUNCI NUMBER(18),
    COD_ESTADO VARCHAR2(8),
    IDE_DOCUMENTO NUMBER(18),
    COD_ORGA_ADMIN VARCHAR2(32),
    CONSTRAINT PPD_TRAZ_DOC_IDE_PPD_FK FOREIGN KEY (IDE_PPD_DOCUMENTO) REFERENCES PPD_DOCUMENTO (IDE_PPD_DOCUMENTO)
);
